    false,nt"url": null,nt"notes": "The Blue Creek Valley area includes about
    250 square miles in a semiarid, sparsely populated section of northwestern Utah.
    Normal annual precipitation in the area ranges from about 15 inches on the valley
    floor to slightly more than 20 inches in the mountains and totals about 184,000
    acre-feet. Surface runoff is about 2,200 acre-feet per year. Average annual ground-water
    recharge and discharge are estimated to be about 14,000 acre-feet each. The largest
    developed water supply in the area is from Blue Springs; the water is impounded
    in Blue Creek Reservoir and is used for irrigation. The discharge of Blue Springs
    is about 7,200 acre-feet per year.",nt"license_title": null,nt"extras":
